        private static byte[] _salt = Encoding.ASCII.GetBytes("a25052017pxko7");

        public static string _BIOSID
        {
            get
            {
                ManagementObjectSearcher mos = new ManagementObjectSearcher("SELECT * FROM Win32_BIOS");
                ManagementObjectCollection moc = mos.Get();
                string motherBoard = "";
                foreach (ManagementObject mo in moc)
                    motherBoard = (string)mo["SerialNumber"];
                return motherBoard;
            }
        }

        public static string _MotherBoardID
        {
            get
            {
                ManagementObjectSearcher mos = new ManagementObjectSearcher("SELECT * FROM Win32_BaseBoard");
                ManagementObjectCollection moc = mos.Get();
                string motherBoard = "";
                foreach (ManagementObject mo in moc)
                    motherBoard = (string)mo["SerialNumber"];
                return motherBoard;
            }
        }

        public static string _ProcessorID
        {
            get
            {
                ManagementObjectSearcher mos = new ManagementObjectSearcher("SELECT * FROM Win32_processor");
                ManagementObjectCollection moc = mos.Get();
                string motherBoard = "";
                foreach (ManagementObject mo in moc)
                    motherBoard = (string)mo["ProcessorID"];
                return motherBoard;
            }
        }

        public static string _DiskCID
        {
            get
            {
                ManagementObject dsk = new ManagementObject("win32_logicaldisk.deviceid=\"C:\"");
                dsk.Get();
                return dsk["VolumeSerialNumber"].ToString();
            }
        }

        public static string _CurrentDiskID
        {
            get
            {
                ManagementObject dsk = new ManagementObject("win32_logicaldisk.deviceid=\"" + AppDomain.CurrentDomain.BaseDirectory.Substring(0, 1) + ":\"");
                dsk.Get();
                return dsk["VolumeSerialNumber"].ToString();
            }
        }

        public static bool _IsVirtual
        {
            get
            {
                {
                    ManagementObjectSearcher mos = new ManagementObjectSearcher("SELECT * FROM Win32_processor");
                    ManagementObjectCollection moc = mos.Get();
                    string val = "";
                    foreach (ManagementObject mo in moc)
                        val = (string)mo["Manufacturer"];
                    if (val.Contains("VBoxVBoxVBox")) return true;
                    if (val.Contains("VMwareVMware")) return true;
                    if (val.Contains("prl hyperv")) return true;
                };
                {
                    ManagementObjectSearcher mos = new ManagementObjectSearcher("SELECT * FROM Win32_BaseBoard");
                    ManagementObjectCollection moc = mos.Get();
                    string val = "";
                    foreach (ManagementObject mo in moc)
                        val = (string)mo["Manufacturer"];
                    if (val.Contains("Microsoft Corporation")) return true;                    
                };
                {
                    ManagementObjectSearcher mos = new ManagementObjectSearcher("SELECT * FROM Win32_DiskDrive");
                    ManagementObjectCollection moc = mos.Get();
                    string val = "";
                    foreach (ManagementObject mo in moc)
                        val = (string)mo["PNPDeviceID"];
                    if (val.Contains("VBOX_HARDDISK")) return true;
                    if (val.Contains("VEN_VMWARE")) return true;                    
                };
                return false;
            }
        }

        public static string GetSystemID(bool BIOS, bool MotherBoard, bool CPU, bool DiskC, bool CurrDisk)
        {
            string code = "";
            try
            {
                if (BIOS) code += "/" + _BIOSID;
            }
            catch { };
            try
            {
                if (MotherBoard) code += "/" + _MotherBoardID;
            }
            catch { };
            try
            {
                if (CPU) code += "/" + _ProcessorID;
            }
            catch { };
            try
            {
                if (DiskC) code += "/" + _DiskCID;
            }
            catch { };
            try
            {
                if (CurrDisk) code += "/" + _CurrentDiskID;
            }
            catch { };

            int codeType = (BIOS ? 1 : 0) + (MotherBoard ? 2 : 0) + (CPU ? 4 : 0) + (DiskC ? 8 : 0) + (CurrDisk ? 0x10 : 0);
            
            //return codeType.ToString("X2") + "-" + 
            
            return GetHash(code);
        }

        private static string GetHash(string s)
        {
            MD5 sec = new MD5CryptoServiceProvider();
            ASCIIEncoding enc = new ASCIIEncoding();
            byte[] bt = enc.GetBytes(s);
            return GetHexString(sec.ComputeHash(bt));
        }

        private static string GetHexString(byte[] bt)
        {
            string s = string.Empty;
            for (int i = 0; i < bt.Length; i++)
            {
                byte b = bt[i];
                int n, n1, n2;
                n = (int)b;
                n1 = n & 15;
                n2 = (n >> 4) & 15;
                if (n2 > 9)
                    s += ((char)(n2 - 10 + (int)'A')).ToString();
                else
                    s += n2.ToString();
                if (n1 > 9)
                    s += ((char)(n1 - 10 + (int)'A')).ToString();
                else
                    s += n1.ToString();
                if ((i + 1) != bt.Length && (i + 1) % 2 == 0) s += "-";
            }
            return s;
        }

        public static string Encrypt(string plainText, string sharedSecret)
        {
            if (string.IsNullOrEmpty(plainText))
                throw new ArgumentNullException("plainText");
            if (string.IsNullOrEmpty(sharedSecret))
                throw new ArgumentNullException("sharedSecret");

            string outStr = null;                       // Encrypted string to return
            RijndaelManaged aesAlg = null;              // RijndaelManaged object used to encrypt the data.

            try
            {
                // generate the key from the shared secret and the salt
                Rfc2898DeriveBytes key = new Rfc2898DeriveBytes(sharedSecret, _salt);

                // Create a RijndaelManaged object
                aesAlg = new RijndaelManaged();
                aesAlg.Key = key.GetBytes(aesAlg.KeySize / 8);

                // Create a decrytor to perform the stream transform.
                ICryptoTransform encryptor = aesAlg.CreateEncryptor(aesAlg.Key, aesAlg.IV);

                // Create the streams used for encryption.
                using (MemoryStream msEncrypt = new MemoryStream())
                {
                    // prepend the IV
                    msEncrypt.Write(BitConverter.GetBytes(aesAlg.IV.Length), 0, sizeof(int));
                    msEncrypt.Write(aesAlg.IV, 0, aesAlg.IV.Length);
                    using (CryptoStream csEncrypt = new CryptoStream(msEncrypt, encryptor, CryptoStreamMode.Write))
                    {
                        using (StreamWriter swEncrypt = new StreamWriter(csEncrypt))
                        {
                            //Write all data to the stream.
                            swEncrypt.Write(plainText);
                        }
                    }
                    outStr = Convert.ToBase64String(msEncrypt.ToArray());
                }
            }
            finally
            {
                // Clear the RijndaelManaged object.
                if (aesAlg != null)
                    aesAlg.Clear();
            }

            // Return the encrypted bytes from the memory stream.
            return outStr;
        }

        public static string Decrypt(string cipherText, string sharedSecret)
        {
            if (string.IsNullOrEmpty(cipherText))
                throw new ArgumentNullException("cipherText");
            if (string.IsNullOrEmpty(sharedSecret))
                throw new ArgumentNullException("sharedSecret");

            // Declare the RijndaelManaged object
            // used to decrypt the data.
            RijndaelManaged aesAlg = null;

            // Declare the string used to hold
            // the decrypted text.
            string plaintext = null;

            try
            {
                // generate the key from the shared secret and the salt
                Rfc2898DeriveBytes key = new Rfc2898DeriveBytes(sharedSecret, _salt);

                // Create the streams used for decryption.                
                byte[] bytes = Convert.FromBase64String(cipherText);
                using (MemoryStream msDecrypt = new MemoryStream(bytes))
                {
                    // Create a RijndaelManaged object
                    // with the specified key and IV.
                    aesAlg = new RijndaelManaged();
                    aesAlg.Key = key.GetBytes(aesAlg.KeySize / 8);
                    // Get the initialization vector from the encrypted stream
                    aesAlg.IV = ReadByteArray(msDecrypt);
                    // Create a decrytor to perform the stream transform.
                    ICryptoTransform decryptor = aesAlg.CreateDecryptor(aesAlg.Key, aesAlg.IV);
                    using (CryptoStream csDecrypt = new CryptoStream(msDecrypt, decryptor, CryptoStreamMode.Read))
                    {
                        using (StreamReader srDecrypt = new StreamReader(csDecrypt))

                            // Read the decrypted bytes from the decrypting stream
                            // and place them in a string.
                            plaintext = srDecrypt.ReadToEnd();
                    }
                }
            }
            catch
            {
                plaintext = "DECRYPT_ERROR";
            }
            finally
            {
                // Clear the RijndaelManaged object.
                if (aesAlg != null)
                    aesAlg.Clear();
            }

            return plaintext;
        }

        private static byte[] ReadByteArray(System.IO.Stream s)
        {
            byte[] rawLength = new byte[sizeof(int)];
            if (s.Read(rawLength, 0, rawLength.Length) != rawLength.Length)
            {
                throw new SystemException("Stream did not contain properly formatted byte array");
            }

            byte[] buffer = new byte[BitConverter.ToInt32(rawLength, 0)];
            if (s.Read(buffer, 0, buffer.Length) != buffer.Length)
            {
                throw new SystemException("Did not read byte array properly");
            }

            return buffer;
        }

